import HomePage from "./Page/Home/HomePage";
import Footer from "./Components/Utility/Footer";
import NavBarLogin from "./Components/Utility/NavBarLogin";
import { BrowserRouter, Route, Routes } from "react-router-dom";


function App() {
  return (
    <div className="font">
    <NavBarLogin />
    <BrowserRouter>
    <Routes>
    <Route></Route>
      <HomePage />
      </Routes>
      </BrowserRouter>
      <Footer />

    </div>
  );
}

export default App;
